import React, { useState, Fragment } from "react";
import { Divider } from "antd";
import Text from "../../common/title";
import OrederListCard from "../../common/orderListCard";

const Information = () => {
  const [data] = useState([
    {
      id: 1,
      table_number: 1,
      url:
        "https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png",
      name: "Alan",
      order: ["bananase"]
    },
    {
      id: 2,
      table_number: 2,
      url:
        "https://gw.alipayobjects.com/zos/rmsportal/JiqGstEfoWAOHiTxclqi.png",
      name: "Mike",
      order: ["cherry ", " orange "]
    }
  ]);
  const [title] = useState("Order Information");

  return (
    <Fragment>
      <div style={{ background: "#fff", padding: 24, minHeight: 680 }}>
        <Text>`${title}`</Text>
        <Divider />
        <OrederListCard data={data} />
      </div>
    </Fragment>
  );
};

export default Information;
